webpackJsonp([0xf3c12faf8795],{3351:function(n,t){n.exports={data:{markdownRemark:{html:"<p><strong>🌡18℃ ☀</strong></p>\n<p>今日、学校の体育館で親子レクリエーションという行事がありました。\n親子で参加する、ミニ運動会みたいなものです。</p>\n<p>最初の種目はカード合わせゲームです。\n早く走ったものの、問題に合う答えのカードを持っている人を探している間に時間を取られ、四位になってしまいました。</p>\n<p>次に紙クズ玉入れゲームをしました。\n紙を一枚ずつ受け取り、それを丸めて玉入れのようにカゴに入れる競技です。\nこれは同点に持ち込めました。</p>\n<p>最後は親子でソーラン節を踊って終わりました。\n楽しかったです。</p>",frontmatter:{cover:null,date:"1990-10-20T21:30:00+09:00",strDate:"1990/10/20",title:"日記"}}},pathContext:{path:"/ja/blog/1990/10/20-diary/",langKey:"ja"}}}});
